import './App.css';

function App() {
  return (
    <div className="App">
      <h1>HotelsNOW</h1>

      <a href="#">Home</a>
      <a href="#">About us</a>
      <a href="#">Our services</a>
      <a href="#">Blog</a>
      <a href="#">Contact us</a>
      <a href="#">Book Now</a>
      <input type="text" placeholder="Destination"/>
      <input type="text" placeholder="Date"/>
      <input type="text" placeholder="Guests"/>
      <input type="text" placeholder="Search"/>
    </div>
  );
}

export default App;
